import React from 'react';
import './App.css';
import TextField from '@material-ui/core/TextField';
import Card from '@material-ui/core/Card';
import Button from '@material-ui/core/Button';
import { makeStyles } from '@material-ui/core/styles';
const useStyles = makeStyles({
  card: {
    maxWidth: 345,
    marginLeft:"37%"
  },
  button: {
    height: 140,
  },
});
function move(elem){
  setInterval(()=>{
    if(elem.style.marginLeft<=500)
      elem.style.marginLeft+=10
    else{
      if(elem.style.marginLeft>=20)
        elem.style.marginLeft-=10
    }
  },100);
}
function App() {
  const classes = useStyles();

  return (
    <div className="App" style={{textAlign:"center"}}>
      Hello to Garbage Collector App<br/>
      <h3>Authtification</h3>
      <Card className={classes.card}>
      <br/>
        <form noValidate autoComplete="off">
            <span>
              <TextField id="standard-basic" variant="outlined" label="Name" />
            </span><br/><br/>
            <span style={{marginTop:40}}>
              <TextField id="standard-basic" variant="outlined" label="Password" />
            </span><br/><br/>
            <Button variant="contained" color="primary">
              Sign-In
            </Button>
        </form>
        <br/>
      </Card>
    </div>
  );
}

export default App;
